import React, {useEffect} from 'react';
import {fetchOnePost, fetchPosts} from "../api/postApi";

const Posts = () => {

    useEffect(() => {
        fetchOnePost()
    },[])
    return (
        <div>
            Posts
        </div>
    );
};

export default Posts;
